import logo from './logo.svg';
import './App.css';
import { useEffect, useState } from 'react';

function App() {
  const [list, setList] = useState([]);

  useEffect(async () => {
    requestWeather();
  }, []);

  const requestWeather = async () => {
    const result = await fetch('https://devapi.qweather.com/v7/weather/3d?location=101210106&key=d822b681e139418ea3e02807da626ada').then(data => data.json());
    console.log(result);
    if (result.code === '200') {
      // 免费版只有3天日期
      let weatherList = result.daily;
      weatherList = weatherList.concat(weatherList, weatherList[0]);
      console.log(weatherList);
      setList(weatherList);
    } else {
      throw new Error('request error');
    }
  };

  return (
    <div className="App">
      123321
    </div>
  );
}

export default App;
